webpackJsonp([0xff16142187df],{8088:function(e,t){e.exports={data:{post:{html:"<p>This year's Whiney Expat Bloggers Meetup will be September 5th and 6th in Munich.</p>\n<p>Selecting the place and date was about as long and complex as selecting a presidential candidate, but that's just how we Americans are. We're now working on an agenda.</p>\n<p>This year we have an online forum at <a href=\"http://www.expatbloggersingermany.com/\">http://www.expatbloggersingermany.com/</a> to help organize the meetup. Access is password only, but any blogger (does Twitter count? or a GeoCities page?) can apply, and non-bloggers can get read-only access.</p>",fields:{title:"Whiney Expat Bloggers Meetup 2009",date:"28 Apr 2009",url:"https://papascott.de/2009-04-28-whiney-expat-bloggers-meetup-2009/"}}},pathContext:{slug:"/2009-04-28-whiney-expat-bloggers-meetup-2009/",prev:{fields:{title:"Stripes from Paris",date:"15 Apr 2009",slug:"/2009-04-15-stripes-from-paris/"}},next:{fields:{title:"East German Nostalgia",date:"06 May 2009",slug:"/2009-05-06-east-german-nostalgia/"}}}}}});
